import React from "react"
import Cell from './Cell'

const Grid = ({ gridData }) => {

  const cntToCode = (cnt) => Math.min(9, Math.max(2, Math.floor(cnt/10)))
  const cntToHex = (cnt) => {
    const code = cntToCode(cnt)
    console.log(code)
    switch(code) {
      case 2:
        return '#bbf7d0'
      case 3:
        return '#86efac'
      case 4:
        return '#4ade80'
      case 5:
        return '#22c55e'
      case 6:
        return '#16a34a'
      case 7:
        return '#15803d'
      case 8:
        return '#166534'
      case 9:
        return '#14532d'
    }
  }

  const handleClick = (idx) => {
    console.log(idx)
  }
  console.log(gridData)
  return (
    <div className='flex flex-col'>
      {gridData.map((ele, idx) => {
          const row = ele.map((data) => 
            <Cell 
              key={data.id} 
              colorHex={cntToHex(data.cnt)}
              data={data} 
              handleClick={() => handleClick(data.id)}/>
          )
        return (
          <div key={idx}>
            {row}
          </div>
        )} 
      )}
    </div>
  )
}

export default Grid
